import React from 'react';



function NewsPreview(props) {

    return (
        <div>
            <a href="">
            <img src={props.image} alt="" />
            <h3>{props.title}</h3>
            <p>{props.country}</p>
            <p>{props.date}</p>
            </a>
        </div>
    )
}

export default NewsPreview;
